P C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam.</p>\r\n\r\n<p><img alt=\"\" height=\"307\" src=\"/uploads/images/222.jpg\" width=\"460\" /></p>\r\n\r\n<p>Tại buổi lễ k&yacute; kết, &ocirc;ng Ph&ugrave;ng Quang Hiệp, Tổng Gi&aacute;m Đốc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam nhấn mạnh: &ldquo;Với tư c&aacute;ch l&agrave; một c&ocirc;ng ty h&agrave;ng đầu về sản suất ph&acirc;n b&oacute;n ở Việt Nam, nhằm cung cấp c&aacute;c giải ph&aacute;p dinh dưỡng c&ocirc;ng nghệ cao cho c&acirc;y trồng, phục vụ sản xuất n&ocirc;ng nghiệp bền vững v&agrave; th&acirc;n thiện với m&ocirc;i trường, C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam đ&atilde; c&oacute; định hướng ph&aacute;t triển đa dạng sản phẩm trong đ&oacute; ch&uacute; trọng c&aacute;c d&ograve;ng ph&acirc;n b&oacute;n NPK, hữu cơ vi sinh ứng dụng khoa học c&ocirc;ng nghệ cao. Th&ocirc;ng qua hợp t&aacute;c n&agrave;y, c&ocirc;ng ty c&oacute; thể đẩy nhanh tiến tr&igrave;nh sản xuất d&ograve;ng sản phẩm mới n&agrave;y để từ đ&oacute; gi&uacute;p n&ocirc;ng d&acirc;n Việt Nam n&acirc;ng cao năng suất, lợi nhuận trong sản xuất n&ocirc;ng nghiệp&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo &ocirc;ng L&ecirc; Văn Hải, Tổng Gi&aacute;m Đốc BiOWiSH Việt Nam, với việc chứng minh b&agrave;o tử vi sinh vật sống được trong m&ocirc;i trường h&oacute;a học m&agrave; cụ thể l&agrave; việc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam sản xuất th&agrave;nh c&ocirc;ng ph&acirc;n b&oacute;n NPK &aacute;o chế phẩm sinh học BiOWiSH đ&atilde; g&oacute;p phần th&uacute;c đẩy phục vụ sản xuất n&ocirc;ng nghiệp c&ocirc;ng nghệ cao tạo ra c&aacute;c n&ocirc;ng sản chất lượng, n&acirc;ng cao chuỗi gi&aacute; trị của n&ocirc;ng nghiệp Vi&ecirc;t Nam.</p>\r\n', '', '', '/uploads/images/2017-09/web-2017-09-18_22-32-17-222.jpg', '0', '1', '1', '0', '2017-09-18 22:32:17', '2017-09-18 22:32:17');
INSERT INTO `articles` VALUES ('6', 'Chế phẩm giúp hữu cơ hóa sản phẩm phân bón hóa học hữu cơ hóa sản phân bón  Chế phẩm giúp hữu cơ hóa sản phẩm phân bón hóa học hữu cơ hóa sản phân bón', 'che-pham-giup-huu-co-hoa-san-pham-phan-bon-hoa-hoc', '1', '<h3>C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC</h3>\r\n\r\n<h4>C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam v&agrave; C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam vừa tổ chức lễ k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC phục vụ sản xuất ph&acirc;n b&oacute;n.</h4>\r\n\r\n<p><br />\r\nChế phẩm sinh học BiOWiSH Crop Liquid Organic l&agrave; giải ph&aacute;p c&ocirc;ng nghệ của C&ocirc;ng ty Biowish Technology (Hoa Kỳ), được C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam phối hợp với Bộ C&ocirc;ng thương Việt Nam đưa về để ứng dụng trong lĩnh vực sản xuất ph&acirc;n b&oacute;n trong nước. Mục đ&iacute;ch nhằm hữu cơ h&oacute;a sản phẩm ph&acirc;n b&oacute;n h&oacute;a học phục vụ cho sản xuất n&ocirc;ng nghiệp c&ocirc;ng nghệ cao gi&uacute;p tăng năng suất, chất lượng sản phẩm v&agrave; bảo vệ m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trong thời gian 18 th&aacute;ng hai b&ecirc;n đ&atilde; hợp t&aacute;c nghi&ecirc;n cứu sản xuất th&agrave;nh c&ocirc;ng sản phẩm NPK c&oacute; bổ sung BiOWiSH&trade; Crop Liquid Organic tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ hiện đại của C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam. Hai b&ecirc;n cũng đ&atilde; tiến h&agrave;nh hợp t&aacute;c khảo nghiệm, thử nghiệm đ&aacute;nh gi&aacute; hiệu quả của sản phẩm mới tr&ecirc;n một số đối tượng c&acirc;y trồng v&agrave; đ&atilde; đạt được c&aacute;c kết quả tốt .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tr&ecirc;n cơ sở đ&oacute; hai b&ecirc;n đ&atilde; tiến h&agrave;nh k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC phục vụ sản xuất ph&acirc;n b&oacute;n giữa C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam v&agrave; C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam.</p>\r\n\r\n<p><img alt=\"\" height=\"307\" src=\"/uploads/images/222.jpg\" width=\"460\" /></p>\r\n\r\n<p>Tại buổi lễ k&yacute; kết, &ocirc;ng Ph&ugrave;ng Quang Hiệp, Tổng Gi&aacute;m Đốc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam nhấn mạnh: &ldquo;Với tư c&aacute;ch l&agrave; một c&ocirc;ng ty h&agrave;ng đầu về sản suất ph&acirc;n b&oacute;n ở Việt Nam, nhằm cung cấp c&aacute;c giải ph&aacute;p dinh dưỡng c&ocirc;ng nghệ cao cho c&acirc;y trồng, phục vụ sản xuất n&ocirc;ng nghiệp bền vững v&agrave; th&acirc;n thiện với m&ocirc;i trường, C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam đ&atilde; c&oacute; định hướng ph&aacute;t triển đa dạng sản phẩm trong đ&oacute; ch&uacute; trọng c&aacute;c d&ograve;ng ph&acirc;n b&oacute;n NPK, hữu cơ vi sinh ứng dụng khoa học c&ocirc;ng nghệ cao. Th&ocirc;ng qua hợp t&aacute;c n&agrave;y, c&ocirc;ng ty c&oacute; thể đẩy nhanh tiến tr&igrave;nh sản xuất d&ograve;ng sản phẩm mới n&agrave;y để từ đ&oacute; gi&uacute;p n&ocirc;ng d&acirc;n Việt Nam n&acirc;ng cao năng suất, lợi nhuận trong sản xuất n&ocirc;ng nghiệp&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo &ocirc;ng L&ecirc; Văn Hải, Tổng Gi&aacute;m Đốc BiOWiSH Việt Nam, với việc chứng minh b&agrave;o tử vi sinh vật sống được trong m&ocirc;i trường h&oacute;a học m&agrave; cụ thể l&agrave; việc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam sản xuất th&agrave;nh c&ocirc;ng ph&acirc;n b&oacute;n NPK &aacute;o chế phẩm sinh học BiOWiSH đ&atilde; g&oacute;p phần th&uacute;c đẩy phục vụ sản xuất n&ocirc;ng nghiệp c&ocirc;ng nghệ cao tạo ra c&aacute;c n&ocirc;ng sản chất lượng, n&acirc;ng cao chuỗi gi&aacute; trị của n&ocirc;ng nghiệp Vi&ecirc;t Nam.</p>\r\n', '', '', '/uploads/images/2017-09/web-2017-09-18_22-32-17-222.jpg', '0', '1', '1', '0', '2017-09-18 22:32:17', '2017-09-18 22:32:17');
