INSERT INTO `articles` VALUES ('8', 'Chế phẩm giúp hữu cơ hóa sản phẩm phân bón hóa học hữu cơ hóa sản phân bón', 'che-pham-giup-huu-co-hoa-san-pham-phan-bon-hoa-hoc', '1', '<h3>C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC</h3>\r\n\r\n<h4>C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam v&agrave; C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam vừa tổ chức lễ k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC phục vụ sản xuất ph&acirc;n b&oacute;n.</h4>\r\n\r\n<p><br />\r\nChế phẩm sinh học BiOWiSH Crop Liquid Organic l&agrave; giải ph&aacute;p c&ocirc;ng nghệ của C&ocirc;ng ty Biowish Technology (Hoa Kỳ), được C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam phối hợp với Bộ C&ocirc;ng thương Việt Nam đưa về để ứng dụng trong lĩnh vực sản xuất ph&acirc;n b&oacute;n trong nước. Mục đ&iacute;ch nhằm hữu cơ h&oacute;a sản phẩm ph&acirc;n b&oacute;n h&oacute;a học phục vụ cho sản xuất n&ocirc;ng nghiệp c&ocirc;ng nghệ cao gi&uacute;p tăng năng suất, chất lượng sản phẩm v&agrave; bảo vệ m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trong thời gian 18 th&aacute;ng hai b&ecirc;n đ&atilde; hợp t&aacute;c nghi&ecirc;n cứu sản xuất th&agrave;nh c&ocirc;ng sản phẩm NPK c&oacute; bổ sung BiOWiSH&trade; Crop Liquid Organic tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ hiện đại của C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam. Hai b&ecirc;n cũng đ&atilde; tiến h&agrave;nh hợp t&aacute;c khảo nghiệm, thử nghiệm đ&aacute;nh gi&aacute; hiệu quả của sản phẩm mới tr&ecirc;n một số đối tượng c&acirc;y trồng v&agrave; đ&atilde; đạt được c&aacute;c kết quả tốt .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tr&ecirc;n cơ sở đ&oacute; hai b&ecirc;n đ&atilde; tiến h&agrave;nh k&yacute; kết hợp đồng cung cấp chế phẩm sinh học BiOWiSH CROP LIQUID ORGANIC phục vụ sản xuất ph&acirc;n b&oacute;n giữa C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam v&agrave; C&ocirc;ng ty CP C&ocirc;ng Nghệ Sinh Học BiOWiSH Việt Nam.</p>\r\n\r\n<p><img alt=\"\" height=\"307\" src=\"/uploads/images/222.jpg\" width=\"460\" /></p>\r\n\r\n<p>Tại buổi lễ k&yacute; kết, &ocirc;ng Ph&ugrave;ng Quang Hiệp, Tổng Gi&aacute;m Đốc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam nhấn mạnh: &ldquo;Với tư c&aacute;ch l&agrave; một c&ocirc;ng ty h&agrave;ng đầu về sản suất ph&acirc;n b&oacute;n ở Việt Nam, nhằm cung cấp c&aacute;c giải ph&aacute;p dinh dưỡng c&ocirc;ng nghệ cao cho c&acirc;y trồng, phục vụ sản xuất n&ocirc;ng nghiệp bền vững v&agrave; th&acirc;n thiện với m&ocirc;i trường, C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam đ&atilde; c&oacute; định hướng ph&aacute;t triển đa dạng sản phẩm trong đ&oacute; ch&uacute; trọng c&aacute;c d&ograve;ng ph&acirc;n b&oacute;n NPK, hữu cơ vi sinh ứng dụng khoa học c&ocirc;ng nghệ cao. Th&ocirc;ng qua hợp t&aacute;c n&agrave;y, c&ocirc;ng ty c&oacute; thể đẩy nhanh tiến tr&igrave;nh sản xuất d&ograve;ng sản phẩm mới n&agrave;y để từ đ&oacute; gi&uacute;p n&ocirc;ng d&acirc;n Việt Nam n&acirc;ng cao năng suất, lợi nhuận trong sản xuất n&ocirc;ng nghiệp&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo &ocirc;ng L&ecirc; Văn Hải, Tổng Gi&aacute;m Đốc BiOWiSH Việt Nam, với việc chứng minh b&agrave;o tử vi sinh vật sống được trong m&ocirc;i trường h&oacute;a học m&agrave; cụ thể l&agrave; việc C&ocirc;ng ty CP Ph&acirc;n B&oacute;n Miền Nam sản xuất th&agrave;nh c&ocirc;ng ph&acirc;n b&oacute;n NPK &aacute;o chế phẩm sinh học BiOWiSH đ&atilde; g&oacute;p phần th&uacute;c đẩy phục vụ sản xuất n&ocirc;ng nghiệp c&ocirc;ng nghệ cao tạo ra c&aacute;c n&ocirc;ng sản chất lượng, n&acirc;ng cao chuỗi gi&aacute; trị của n&ocirc;ng nghiệp Vi&ecirc;t Nam.</p>\r\n', '', '', '/uploads/images/2017-09/web-2017-09-18_22-32-17-222.jpg', '0', '1', '1', '0', '2017-09-18 22:32:17', '2017-09-18 22:32:17');
INSERT INTO `articles` VALUES ('9', 'Giá nông sản hôm nay 2.12: Sau phiên giảm mạnh, giá cà phê tăng trở lại, giá tiêu tiếp tục đứng yên', 'gia-nong-san-hom-nay-2.12:-sau-phien-giam-manh,-gia-ca-phe-tang-tro-lai,-gia-tieu-tiep-tuc-dung-yen', '1', '<p>Gi&aacute; c&agrave; ph&ecirc; h&ocirc;m nay (2.12) sau một phi&ecirc;n giảm mạnh ng&agrave;y h&ocirc;m qua đ&atilde; bắt đầu tăng trở lại. Gi&aacute; tại c&aacute;c tỉnh giao dịch trong ngưỡng 35.700 &ndash; 37.000 đồng/kg. Gi&aacute; ti&ecirc;u h&ocirc;m nay tiếp tục đi ngang, kh&ocirc;ng c&oacute; nhiều biến động, giao dịch trong khoảng 75.500 &ndash; 77.000 đồng/kg.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Gi&aacute; c&agrave; ph&ecirc; tăng trở lại</strong></p>\r\n\r\n<p><a href=\"https://2.bp.blogspot.com/-85gqhj98U2A/WiIiW4n-IGI/AAAAAAAABFs/K1RQymUaxPM3jlDyA1wPOSIJbBQ3sTLUwCLcBGAs/s1600/gia_ca_phe_hom_nay_2_12-1512176178-width640height406.jpg\"><img alt=\"\" height=\"406\" src=\"https://2.bp.blogspot.com/-85gqhj98U2A/WiIiW4n-IGI/AAAAAAAABFs/K1RQymUaxPM3jlDyA1wPOSIJbBQ3sTLUwCLcBGAs/s640/gia_ca_phe_hom_nay_2_12-1512176178-width640height406.jpg\" width=\"640\" /></a></p>\r\n\r\n<p>Sau phi&ecirc;n giảm mạnh, gi&aacute; c&agrave; ph&ecirc; đ&atilde; c&oacute; dấu hiệu phục hồi&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sau phi&ecirc;n giảm mạnh ng&agrave;y h&ocirc;m qua, tại nhiều địa phương gi&aacute; c&agrave; ph&ecirc; đ&atilde; giảm từ 700 &ndash; 1.1000 đồng/kg. Đến phi&ecirc;n giao dịch h&ocirc;m nay, gi&aacute; c&agrave; ph&ecirc; tr&ecirc;n thị trường thế giới đ&atilde; tăng trở lại k&eacute;o theo sự biến động tăng l&ecirc;n ở trong nước. Gi&aacute; tại c&aacute;c tỉnh giao dịch ở mức 35.700 &ndash; 37.000 đồng/kg.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Xuất khẩu c&agrave; ph&ecirc; ni&ecirc;n vụ 2017/18 đ&atilde; bắt đầu v&agrave;o th&aacute;ng 10 vừa qua nhưng số liệu từ ICO cho thấy hoạt động giao dịch c&agrave; ph&ecirc; khởi động chậm chạp. Xuất khẩu c&agrave; ph&ecirc; từ top 4 nước sản xuất lớn nhất &ndash; Brazil, Việt Nam, Colombia v&agrave; Indonesia &ndash; đều giảm trong th&aacute;ng 10.2017 so với c&ugrave;ng kỳ năm 2016. Xuất khẩu c&agrave; ph&ecirc; to&agrave;n cầu năm 2016 ghi nhận mức cao kỷ lục, theo dữ liệu ICO cho thấy lượng xuất khẩu đạt 122,5 triệu bao.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Theo số liệu hải quan cho thấy, xuất khẩu c&agrave; ph&ecirc; của Việt Nam th&aacute;ng 10.2017 giảm 22,1% so với c&ugrave;ng kỳ năm 2016. Mưa lớn đang ảnh hưởng nhiều tới thu hoạch của b&agrave; con trồng c&agrave; ph&ecirc; ở T&acirc;y Nguy&ecirc;n. Tuy nhi&ecirc;n c&aacute;c dự b&aacute;o cho vụ sản xuất năm 2017 rất t&iacute;ch cực: USDA dự b&aacute;o sản lượng c&agrave; ph&ecirc; Việt Nam ni&ecirc;n vụ 2017-18 sẽ tăng 1,9 triệu bao l&ecirc;n 28,6 triệu bao, đủ đ&aacute;p ứng c&aacute;c nh&agrave; xuất khẩu. Rabobank dự b&aacute;o nhu cầu thế giới đối với c&agrave; ph&ecirc; tiếp tục tăng, dẫn đến dự b&aacute;o tăng nhẹ gi&aacute; c&agrave; ph&ecirc; trong năm 2018, bất chấp khả năng thặng dư 3 triệu bao c&agrave; ph&ecirc; trong ni&ecirc;n vụ 2018/19.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kết th&uacute;c phi&ecirc;n giao dịch, tr&ecirc;n s&agrave;n ICE Europe &ndash; London, gi&aacute; c&agrave; ph&ecirc; Robusta tăng trở lại. Kỳ hạn giao ngay tháng 1/2018 tăng th&ecirc;m 27 USD, l&ecirc;n 1.753 USD/t&acirc;́n, trong khi kỳ hạn giao th&aacute;ng 3/2018 tăng th&ecirc;m 26 USD, xuống 1.750 USD/tấn v&agrave; kỳ hạn giao th&aacute;ng 5/2018 giảm th&ecirc;m 24 USD, c&ograve;n 1.760 USD/tấn, c&aacute;c mức giảm nhẹ. Tr&ecirc;n s&agrave;n ICE US &ndash; New York, gi&aacute; c&agrave; ph&ecirc; Arabica cũng tăng nhẹ. Kỳ hạn th&aacute;ng 12/2017 tăng th&ecirc;m 1,25 cent, l&ecirc;n 127,55 cent/lb v&agrave; kỳ hạn giao th&aacute;ng 3/2018 tăng th&ecirc;m 1,05 cent, l&ecirc;n 129,55 cent/lb, c&aacute;c mức tăng nhẹ. Khối lượng giao dịch ở mức trung bình.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Gi&aacute; ti&ecirc;u tiếp tục ảm đạm</strong></p>\r\n\r\n<p><a href=\"https://3.bp.blogspot.com/-OTFBa2VQ_iM/WiIinaAkQ6I/AAAAAAAABFw/yvlxwy4ZGK0eEuqAYQsPyR6BM7-qzbAVQCLcBGAs/s1600/gia_tieu_hom_nay_2_12-1512176249-width480height318.jpg\"><img alt=\"\" height=\"424\" src=\"https://3.bp.blogspot.com/-OTFBa2VQ_iM/WiIinaAkQ6I/AAAAAAAABFw/yvlxwy4ZGK0eEuqAYQsPyR6BM7-qzbAVQCLcBGAs/s640/gia_tieu_hom_nay_2_12-1512176249-width480height318.jpg\" width=\"640\" /></a></p>\r\n\r\n<p>Gi&aacute; ti&ecirc;u vẫn kh&ocirc;ng c&oacute; nhiều thay đổi v&igrave; thị trường đang dồi d&agrave;o&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hiện gi&aacute; ti&ecirc;u h&ocirc;m nay vẫn giao dịch trong khoảng 75.500 &ndash; 78.000 đồng/kg. Mặc d&ugrave; tuần qua gi&aacute; ti&ecirc;u c&oacute; &iacute;t biến động nhẹ, song gi&aacute; ti&ecirc;u vẫn chưa bật qua ngưỡng 78.000 đồng/kg.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tr&ecirc;n thị trường đầu mối, 5 tấn hồ ti&ecirc;u hỗn hợp được giao dịch với mức 375 rupee/kg. Hồ ti&ecirc;u 550 GL từ loại hồ ti&ecirc;u chất lượng cao được b&aacute;n với mức 400 rupee/kg. Hồ ti&ecirc;u Ấn Độ xuất khẩu sang ch&acirc;u &Acirc;u ở mức gi&aacute; 6.600 USD/tấn v&agrave; sang Mỹ l&agrave; 6.850 USD/tấn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hiện nay Brazil cũng đang rất được m&ugrave;a hồ ti&ecirc;u, gi&aacute; th&agrave;nh sản xuất ti&ecirc;u tại nước n&agrave;y chỉ khoảng 2USD/kg, tức khoảng 45.000 đồng/kg. B&ecirc;n cạnh đ&oacute;, sản lượng của c&aacute;c nước trồng ti&ecirc;u kh&aacute;c như Ấn Độ, Srilanka, Indonesia v&agrave; cả Trung Quốc, Campuchia cũng kh&aacute; dồi d&agrave;o, chất lượng tốt. Do đ&oacute;, bức tranh ti&ecirc;u thụ hồ ti&ecirc;u của Việt Nam thời gian tới sẽ kh&aacute; ảm đạm.&nbsp;</p>\r\n\r\n<p>Nguồn : D&acirc;n Việt</p>\r\n', '', '', '/uploads/images/2017-12/web-2017-12-10_20-39-29-giacafe.jpg', '0', '1', '1', '0', '2017-12-10 20:39:29', '2017-12-10 20:39:29');
